    true,nt"url": null,nt"notes": "<p>State officials use the OCSE-157 to report
    annual statistical and financial information on their Child Support Enforcement
    (CSE) program to the Department of Health and Human Services (HHS). This information
    will enable the Secretary of HHS to comply with sections 409, 452(a) and (g), 458,
    and 469 of the Social Security Act (the Act). The Act requires the Secretary to
    establish standards for an effective Child Support Enforcement program,  and to
    make an Annual Report to the Congress on program activities. Information submitted
    by states will also enable HHS to compute individual state incentive, penalty, and
    outcome measures to be used in evaluating state performance in running a CSE program.
    The authority to collect this information is also set forth in regulations at 45
    CFR 30</p>n",nt"license_title": "Other License Specified",nt"extras":
